import { useState } from "react";
import { ReactDOM } from "react-dom";
import react from "react";
import { useRef } from "react";
var sc=document.getElementById('score');

function All_car(){
    var [button,buton_value]=useState(0);
    

       var [a,avalue]=useState((Math.random()*70));
       var [b,bvalue]=useState((Math.random()*70));
       var [c,cvalue]=useState((Math.random()*70));
       var [d,dvalue]=useState((Math.random()*70));
       var [e,evalue]=useState((Math.random()*70));
       
       function Update_cars(){

        avalue((Math.random()*70));
        bvalue((Math.random()*70));
        cvalue((Math.random()*70));
        dvalue((Math.random()*70));
        evalue((Math.random()*70));
        buton_value(button+5)
        // var ee=sc.innerText
        // var s=parseInt(ee,10)+5
        // sc.innerText=s
        // return(console.log(ee))
          }
    
    return((<div>

<div style={{display:"flex"}}>
                <div style={{ backgroundColor:"black",
                width:'fit-content',
                 position:'relative',
                     zIndex:"10",
                     marginLeft:"30vw",
                         }}>score:{button}
                        
                         </div>
                         

                 
        </div>



      <section style={{display:"flex"}}>
     <div  className='redcar'
    
     style={{padding:(40 +"px "+15+"px"),
      position:'absolute',
      borderRadius:"30px",
      animation: "car-animation "+(5)+"s infinite",
      backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
     marginLeft:(a+"vw"),
     marginTop:(-8)+"vh",
    //  onAnimationEnd;
     }}
     onAnimationIteration={Update_cars}

     > 
  </div>
  
  <div className='redcar'
     style={{padding:(40 +"px "+15+"px"),
  position:'absolute',
  borderRadius:"30px",
  
  animation: "car-animation "+(5)+"s infinite",
  backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
  marginLeft:(b+"vw"),
  marginTop:(-20)+"vh",}}> 
  </div>


  <div className='redcar'
    
     style={{padding:(40 +"px "+15+"px"),
  position:'absolute',
  borderRadius:"30px",
  animation: "car-animation "+((5))+"s infinite",
  backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
  marginLeft:(c+"vw"),
  marginTop:(-40)+"vh",}}> 
  </div>
  
  <div className='redcar'
     style={{padding:(40 +"px "+15+"px"),
  position:'absolute',
  borderRadius:"30px",
  animation: "car-animation "+(5)+"s infinite",
  backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
  marginLeft:(d+"vw"),
  marginTop:(-60)+"vh",}}> 
  </div>


  <div className='redcar'
     style={{padding:(40 +"px "+15+"px"),
  position:'absolute',
  borderRadius:"30px",
  animation:
   "car-animation "+(5)+"s infinite",
  backgroundColor:"rgb("+Math.random()*300+','+Math.random()*300+','+ Math.random()*300+')',
  marginLeft:(e+"vw"),
  marginTop:(-80)+"vh",}}> 
  </div>

</section>
</div>
    
  ))
  }
  
// function All_car(){
    
//     return((
//     <div>
//       <Redcar />
      
//     </div>
//           ))}
export default All_car;
